INSERT INTO `soal` VALUES ('5','1','5','Saat akan membuat teks hasil observasi, terlebih dahulu perhatikan hal-hal yang berkaitan dengan teks observasi, seperti …','1','mengetahui objek dengan baik','menilai objek secara keseluruhan','mengamati objek yang akan diobservasi','melakukan penelitian terhadap objek','meneliti objek dengan sesama','C','','','','','','','');
