INSERT INTO `soal` VALUES ('7','1','7','Berikut ini termasuk fungsi dari teks laporan hasil observasi, kecuali …','1','memberitahukan atau menjelaskan tanggung jawab tugas dan kegiatan pengamatan','memberitahukan atau menjelaskan dasar penyusunan kebijaksanaan, kepustusan atau pemecahan masalah dalam pengamatan','merupakan sumber informasi','merupakan bahan untuk pendokumentasian','merupakan hasil analisis dari teks laporan','E','','','','','','','');
INSERT INTO `soal` VALUES ('8','1','8','Berikut ini termasuk kaidah-kaidah yang harus diperhatikan dalam pembuatan teks laporan hasil observasi, kecuali …','1','bersifat global dan universal','merupakan hasil penelitian terkini','menggunakan bahasa Indonesia yang baik dan benar','merupakan hasil kesepakatan bersama','objek yang dibicarakan atau yang menjadi pembahasan adalah objek tunggal','D','','','','','','','');
INSERT INTO `soal` VALUES ('9','1','9','Teks laporan hasil observasi memuat informasi yang disajikan harus sesuai dengan ..... yang didapatkan dari hasil penelitian. Kata yang tepat untuk mengisi titik-titik di atas adalah....','1','opini','fakta','pendapat','argumentasi','penjelas','B','','','','','','','');
INSERT INTO `soal` VALUES ('10','1','10','Teks laporan hasil observasi adalah teks yang berisi penjabaran umum/melaporkan sesuatu berupa hasil dari …','1','pengamatan','penilaian','koreksi','penulisan','peluang','A','','','','','','','');
INSERT INTO `soal` VALUES ('11','1','11','Jenis teks laporan hasil observasi mendeskripsikan atau menggambarkan bentuk, ciri, atau sifat umum, seperti hal-hal berikut, kecuali …','1','benda','hewan','tumbuh-tumbuhan','peristiwa','keindahan bumi','E','','','','','','','');
INSERT INTO `soal` VALUES ('12','1','12','Berikut ini termasuk ciri-ciri dari teks laporan hasil observasi, kecuali …','1','bersifat objektif','mengandung pendapat tokoh ahli','harus ditulis sempurna dan lengkap','tidak memasukkan hal-hal yang menyimpangm mengandung prasangka, atau pemihakan','disajikan secara menarik, baik dalam hal tata bahasa yang jelas, isinya berbobot, maupun susunan logis','B','','','','','','','');
INSERT INTO `soal` VALUES ('13','1','13','Dalam teks laporan hasil observasi, informasi harus disampaikan secara …','1','nyata','berdasarkan kenyataan','global atau menyeluruh','opini publik','baik dan terarah','C','','','','','','','');
INSERT INTO `soal` VALUES ('14','1','14','Teks laporan hasil observasi harus disajikan dengan menggunakan bahasa yang jelas, mudah dipahami, dan tidak berbelit-belit. Hal ini dilakukan untuk menghindari …','1','kesalahpahaman pembaca','keterlibatan tokoh masyarakat','kesalahan penulisan','salah tafsir','salah menguraikan pendapat/opini','A','','','','','','','');
INSERT INTO `soal` VALUES ('15','1','15','Perhatikan teks laporan hasil observasi berikut !\nMakhluk di dunia ini dibedakan menjadi dua jenis secara umum, yakni makhluk yang hanya bisa bergerak dan berperasaan serta makhluk yang bisa bergerak, berperasaan, dan berpikir (makhluk yang sempurna). Klasifikasi ini didasarkan atas anugerah Tuhan Yang Maha Esa kepada Manusia sebagai makhluk ciptaan Tuhan yang lainnya.\nTema teks laporan hasil observasi di atas adalah …','1','keagungan manusia','makhluk ciptaan Tuhan','kesempurnaan Tuhan','ciri-ciri manusia','dua makhluk yang berbeda','B','','','','','','','');
INSERT INTO `soal` VALUES ('16','1','16','Kalimat dalam teks anekdot berikut yang merupakan kalimat imperatif adalah …','1','Si pejabat ini tergelincir dan terperosok ke sungai.','Seorang kawan Nasruddin membungkuk ke tepi sungai dan mengulurkan tangannya.','\"Berikanlah tanganmu,\" kata si kawan Nasruddin.','Namun, si pejabat tersebut hanya diam saja.','\"Kau keliru,\" ujar Nasruddin kepada kawannya ini.','C','','','','','','','');
INSERT INTO `soal` VALUES ('17','1','17','“Akhirnya, Ia berjanji, setelah peristiwa ini, Ia akan menjadi sosok yang lebih baik.”\nKutipan teks anekdot di atas merupakan struktur teks anekdot bagian …','1','Abstraksi','Orientasi','Reaksi','Krisis','Koda','E','','','','','','','');
