INSERT INTO `soal` VALUES ('20','1','20','Guru : Anak-anak, selain mendapatkan pelajaran saat jam belajar di sekolah, kalian juga bisa mengikuti kegiatan ekstrakurikuler. Adpaun ekstrakulikuler yang dapat kalian ikuti adalah basket, sepak bola, Pramuka, PMR, dan Paskibra. Ada pertanyaan?\nJono : Pak, apa sih manfaat kita mengikuti ekstrakulikuler?\nLatar dari cerita tersebut adalah …','1','Sekolah','lapangan','pasar','rumah','terminal','A','','','','','','','');
INSERT INTO `soal` VALUES ('21','1','21','Struktur teks anekdot adalah …','1','Pernyataan umum-deskripsi bagian','Pernyataan pendapat-argumentasi-penegasan ulang','Orientasi-argumentasi-penutup','Pembuka-isi-penutup','abstraksi–Orientasi–reaksi–Krisis-koda','E','','','','','','','');
