INSERT INTO `soal` VALUES ('25','1','25','Suatu hari guru menerangkan tentang biopori di depan kelas. “ Biopori itu bisa dijadikan sebagai salah satu usaha menghindari banjir”jelasnya. “Sekarang, Ibu beri tugas pada kalian untuk membuat biopori di sekitar rumah, lalu kalian foto. Fotonya nanti ditempel di buku tugas dan berikan deskripsi”. Tiba-tiba seorang anak berkomentar.”Syukurlah Bu, jalan menuju rumah saya sudah banyak bioporinya, tapi kata bapak itu bukan untuk menanggulangi banjir, melainkan biopori akibat sering banjir”. Mendengar itu semua anak dan Bu guru tertawa.\nKalimat yang menunjukkan krisis adalah ...','1','Suatu hari guru menerangkan tentang biopori di depan kelas.','“Biopori itu bisa dijadikan sebagai salah satu usaha menghindari banjir”jelasnya','Sekarang, Ibu beri tugas pada kalian untuk membuat biopori di sekitar rumah, lalu kalian foto.','”Syukurlah Bu, jalan menuju rumah saya sudah banyak bioporinya, tapi kata bapak itu bukan untuk menanggulangi banjir, melainkan biopori akibat sering banjir”','Mendengar itu semua anak dan Bu guru tertawa','D','','','','','','','');
INSERT INTO `soal` VALUES ('26','1','26','Susunlah anekdot berikut ini sesuai dengan strukturnya!\n(1) Bu guru pun tersenyum\n(2) Siapa yang bisa membuat perumpamaan bagi penegakan hukum di negeri kita? Tanya Bu guru di depan kelas.\n(3) Bu guru bertanya kenapa disebut hukum kantong kresek\n(4) Tidak lama kemudian seorang anak menjawab dengan lantang\n(5) Hukum kantong kresek Bu, kata anak itu.\n(6) Hanya bisa menyelesaikan kasus kecil Bu, kalau kasus besar tidak pernah muat.','1','1-2-3-4-5-6','2-4-5-3-6-1','2-4-3-5-1-6','1-2-4-5-3-6','3-2-1-4-5-6','B','','','','','','','');
INSERT INTO `soal` VALUES ('27','1','27','Berikut ini yang bukan ciri-ciri teks anekdot adalah …','1','struktur teks orientasi-krisis-reaksi','memiliki pesan moral','memiliki unsur lucu','berbentuk cerita','menggelitik','D','','','','','','','');
INSERT INTO `soal` VALUES ('28','1','28','Berikut ini , yang termasuk teks anekdot adalah …','1','Harimau (Panthera tigris) digolongkan ke dalam mamalia, yaitu binatang yang menyusui. “Kucing besar”itu adalah hewan pemangsa dan pemakan daging. Harimau dapat mencapai tinggi 1,5 meter, panjang 3,3 meter, dan berat 300 kilogram. Bulunya berwarna putih dan cokelat keemasan-emasan dengan belang atau loreng berwarna hitam','Saudara-saudara yang saya hormati, Beberapa hari yang lalu, masyarakat sedang merayakan pesta demokrasi—memilih presiden dan wakil presiden secara langsung.Saya berharap, siapapun yang menjadi presiden dan wakil presiden, kita harus berlapang dada untuk menerima segala kebijakannya','Pernahkah Anda membuat SIM, misalnya SIM C? Mengurus SIM tentu memerlukan waktu dan biaya. Tulisan ini bertujuan untuk berbagi pengalaman dalam mengurus SIM C dengan jalan yang benar','Perdagangan bebas yang diusung oleh sebuah negara dipastikan dapat menguntungkan atau merugikan negara yang bersangkutan. Dampak negatif kebijakan politik negara di sektor ekonomi ini mudah kita temukan di Indonesia.','Ibu-ibu sedang kerja bakti membersihkan jalan desa pada pagi hari. Suasana terkesan ramai, obrolan seputar harga, gosip, dan anak. “Wah, bulan ini banyak pangeluaran. Anak saya masuk kuliah dan adiknya masuk SMA,” kata Bu Tini “Semua ternak saya, saya sekolahkan Bu biar pintar” sambung Bu Tini “He..he..he” tawa Bu Romlah renyah Mereka pun melanjutkan membersihkan rumput di kanan dan kiri','E','','','','','','','');
INSERT INTO `soal` VALUES ('29','1','29','Yang merupakan tujuan penulisan teks anekdot, yaitu …','1','Memberi petunjuk','Memberi argumentasi','Membuat bingung','Menghibur','Menganalisis','D','','','','','','','');
INSERT INTO `soal` VALUES ('30','1','30','Sindiran dalam teks anekdot dapat diungkapkan dengan antonim. Pasangan kata dibawah ini yang merupakan antonim, kecuali …','1','Benar – Salah','adil - tidak adil','kaya - miskin','rajin - malas','target - sasaran','E','','','','','','','');
INSERT INTO `soal` VALUES ('31','1','31','Berikut ini adalah ciri-ciri hikayat, kecuali …','1','Anonim','Khayal','Logis','Lisan','Istana Sentris','C','','','','','','','');
INSERT INTO `soal` VALUES ('32','1','32','Bacalah penggalan hikayat “Indera Bangsawan” berikut! Maka anakanda baginda yang dua orang itu pun sampailah usia tujuh tahun dan dititahkan pergi mengaji kepada Mualim Sufian. Sesudah tahu mengaji, mereka dititah pula mengaji kitab usul, fikih, hingga saraf, tafsir sekaliannya diketahuinya.Sumber teks: Buku Kesusastraan Melayu Klasik. Nilai yang terkandung pada penggalan hikayat di atas yaitu ...','1','Nilai Moral','Nilai Agama','Nilai Budaya','Nilai Pendidikan','Nilai Sosial','D','','','','','','','');
INSERT INTO `soal` VALUES ('33','1','33','(1) bersifat imajinasi.\n(2) mengisahkan tentang kerajaan.\n(3) nama penciptanya tidak diketahui.\n(4) bersifat menyindir.\n(5) bersifat menghibur.\nNomor berapakah yang merupakan ciri-ciri hikayat ...','1','(1), (3), (5)','(2), (4), (5)','(1), (2), (3)','(1), (4), (5)','(3), (4), (5)','C','','','','','','','');
INSERT INTO `soal` VALUES ('34','1','34','Bahasa yang digunakan hikayat adalah …','1','Bahasa Melayu Klasik','Bahasa Indonesia Ragam Sastra','Bahasa Indonesia Baku','Bahasa Melayu','Bahasa Indonesia','A','','','','','','','');
INSERT INTO `soal` VALUES ('35','1','35','Hikayat terdiri dari unsur intrinsik dan ekstrinsik. Yang termasuk unsur intrinsik meliputi …','1','Tema, latar, toko, penokohan, dan sudut pandang.','Tema, jalan cerita, orang yang terlibat, tokoh, sudut pandang, dan antagonis.','Tema, toko, penokohan, latar, alur, amanat, dan sudut pandang.','Pesan, amanat, tokoh,penokohan, latar, alur, dan sudut pandang.','Tema, tokoh, penokohan, latar, alur, amanat, dan sudut pandang.','E','','','','','','','');
INSERT INTO `soal` VALUES ('36','1','36','Yang bukan termasuk unsur intrinsik hikayat …','1','Tokoh','Tema ','Alur','Amanat','Nilai Agama','E','','','','','','','');
INSERT INTO `soal` VALUES ('37','1','37','Beragam jenis hikayat yang ada saat ini dikemukakan dalam buku-buku berikut, kecuali …','1','buku-buku Islami','buku cerita anak-anak','buku pelajaran','buku-buku legenda Melayu','buku-buku sastra','C','','','','','','','');
INSERT INTO `soal` VALUES ('38','1','38','Salah satu bentuk karya sastra prosa lama yang isinya berupa cerita, kisah, dongeng maupun sejarah. Penyataan tersebut merupakan pengertian dari …','1','cerita','cerita rakyat','hikayat','dongeng','novel','C','','','','','','','');
INSERT INTO `soal` VALUES ('39','1','39','Salah satu ciri hikayat adalah anonim, yang berati …','1','mempunyai logika tersendiri yang tidak sama dengan logika umum, ada juga yang menyebut fantastis','menggunakan bahasa yang diulang-ulang','pengarangnya tidak dikenali','meneruskan budaya/tradisi/kebiasaan yang dianggap baik','menceritakan tokoh yang berkaitan dengan kehidupan istana/kerajaan','C','','','','','','','');
INSERT INTO `soal` VALUES ('40','1','40','Hikayat bersifat istana sentris, banyak menggunakan gaya bahasa klise, dan alurnya mudah ditebak sehingga cenderung monoton. Hal ini berbeda dengan karya sastra baru seperti cerpen yang memiliki ...','1','gaya bahasa bebas','alur lebih dinamis','gaya bahasa teratur','alur mengikuti aturan','gaya bahasa bebas dan alur lebih dinamis','E','','','','','','','');
INSERT INTO `soal` VALUES ('41','1','41','Pengarang membawa pembaca ke dunia khayal atau imajinasi yang serba indah. Pernyataan tersebut merupakan salah satu ciri hikayat yang berarti….','1','Anonim','bersifat pralogis','menggunakan bahasa klise','istana sentris','magis','E','','','','','','','');
INSERT INTO `soal` VALUES ('42','1','42','Salah satu bentuk karya sastra prosa lama yang isinya berupa cerita, kisah, dongeng maupun sejarah. Penyataan tersebut merupakan pengertian dari …','1','Dongeng','Cerita ','Cerita rakyat','Hikayat','Novel','D','','','','','','','');
INSERT INTO `soal` VALUES ('43','1','43','Dalam khazanah kesusastraan Indonesia kita mengenal berbagai karya sastra, salah satunya hikayat. Tokoh yang dikisahkan dalam hikayat biasanya …','1','Seorang raja','Presiden','Istana besa','baginda dikerajaan','Rakyat jelata','A','','','','','','','');
INSERT INTO `soal` VALUES ('44','1','44','Hikayat diyakini sebagai cerita rekaan yang hamper menyerupai …. masa lalu.','1','Cerita fiktif','Dongeng','Cerita rekaan','Cerita rakyat','Fabel','B','','','','','','','');
INSERT INTO `soal` VALUES ('45','1','45','Bacalah hikayat berikut! \nMaka kata Indera Bangsawan, “Hamba ini tiada bernama dan tiada tahu akan bapak Hamba, karena diam dalam hutan rimba belantara. Adapun sebabnya hamba kemari ini karena hamba mendengar khabar anak raja sembilan orang hendak datang membunuh buraksa dan merebut tuan hamba dari padanya itu, itulah maka hamba datang kemari hendak melihat tamasya anak raja itu. Mengasihani hamba dan pada bicara akal hamba akan anak raja-raja yang sembilan itu tiadalah dapat membunuh buraksa itu. Jika lain daripada Indera Bangsawan tiada dapat membunuh akan buraksa itu.\nAmanat yang tersirat dalam kutipan sastra klasik tersebut adalah …','1','Basmilah jika melihat kejahatan','Jangan menyombongkan diri','Tunjukkanlah jika memiliki suatu kemampuan','Hendaklah menolong orang yang dalam kesulitan','Bersyukurlah jika mendapat pertolongan','D','','','','','','','');
INSERT INTO `soal` VALUES ('46','1','46','Bacalah penggalan hikayat berikut dengan saksama!\n Pengganti Hang Tuah di keraton adalah Hang Jebat. Sesungguhnya, ia menaruh dendam atas keputusan raja yang dijatuhkan kepada sahabatnya, Hang Tuah. Karena setia kepada sahabatnya, ia mengamuk di keraton. Putri-putri dan dayang-dayang diperlakukan kurang sopan sehingga banyak jugalah orang yang mati karena kerisnya, yang diberikan Hang Tuah kepadanya. Tiada seorang pun yang berani mendinginkan sehingga raja sendiri pun terlibat pula dalam kesulitan dan ketakutan.\n\nDari kutipan cerita di atas kita dapat mengetahui bahwa Hang  Jebat berwatak ….','1','Pemberani','Baik','Sombong','Setia','Kasar','E','','','','','','','');
INSERT INTO `soal` VALUES ('47','1','47','Bacalah penggalan hikayat berikut!\n”Janganlah adinda bertanya jua” jawab baginda dengan sedihnya. ”Pertanyaan itu hanya menambah luka Tuanku jua semata.”\n”Ampun, Tuanku, orang yang arif tiada pernah putus asa sekali pun bagaimana juga cobaan yang datang ke atas dirinya. Tiada pula ia bersedih hati karena kesedihan tiada buahnya selain daripada menguruskan badan saja yang sudah ditakdirkan tiada juga akan tertolak olehnya.”\n(Hikayat Kalilah dan Dimnah)\nNilai moral yang tertuang dalam penggalan cerita di atas tampak pada perbuatan …. ','1','menghormati orang lain','mendahulukan kepentingan umum','menegur orang dengan bahasa yang sopan','menolong orang yang sedang menderita','membantu orang yang sedang bersedih hati','A','','','','','','','');
