INSERT INTO `soal` VALUES ('78','2','28','Assalamu’alaikum Wr. Wb\nYang kami hormati bapak dan ibu serta para hadirirn sekalian yang berbahagia.\nPuji syukur kita sanjungkan kehadirat Allah swt, karena dengan limpahan dan karunia-Nya kita bisa berkumpul di sini. Salawat serta salam semoga tetap tercurahkan kepada junjungan Nabi besar Muhammad saw, karena beliau menyiarkan agama yang haq, yakni agama islam, agama yang diridai oleh Allah swt. Semoga kita sekalian termasuk ke dalam umat-Nya yang diberkahi. Amin ya rabbal alamin.\nHadirin sekalian yang berbahagia!\nDirasa amat penting sekali jiwa sosial untuk diterapkan di lingkungan keluarga, sanak saudara, bahkan juga di masyarakat luas. Karena dengan jiwa sosial, maka terjalinlah di antara kita saling tolong-menolong, dan kasih sayang. Sehngga orang-orang yang butuh akan pertolongan kita, akan mendapatkan haq-Nya.\nTeks tersebut termasuk teks ….\n','1','ceramah','eksplanasi','eksposisi','prosedur','deskripsi','A','','','','','','','');
