INSERT INTO `soal` VALUES ('121','3','21','Hari Buruh, yang dikenal juga dengan sebutan May Day, diperingati setiap 1 Mei. Di beberapa negara, Hari Buruh dijadikan hari libur tahunan, yang berawal dari usaha gerakan serikat buruh untuk merayakan keberhasilan ekonomi dan sosial para buruh. Hari Buruh ini lahir dari rentetan perjuangan kelas pekerja. Pada 1886, terjadi demonstrasi kaum buruh Amerika Serikat yang menuntut pemberlakuan delapan jam kerja. Frederation of Organized Trades and Labor Unions akhirnya menetapkan 1 Mei sebagai Hari Buruh yang diperingati momen tuntutan delapan    jam kerja sehari dan juga memberikan semangat baru perjuangan kelas pekerja yang mencapai titik masif di era tersebut. Kalimat bermasa lampau pada penggalan teks cerita sejarah di atas adalah….','1','Hari Buruh, yang dikenal juga dengan sebutan May Day, diperingati setiap 1 Mei.','Di beberapa negara, Hari Buruh dijadikan hari libur tahunan, yang berawal dari usaha gerakan serikat buruh untuk merayakan keberhasilan ekonomi dan sosial para buruh.','Pada 1886, terjadi demonstrasi kaum buruh Amerika Serikat yang menuntut pemberlakuan delapan jam kerja.','Frederation of Organized Trades and Labor Unions akhirnya menetapkan 1 Mei sebagai Hari Buruh yang diperingati momen tuntutan delapan jam kerja sehari dan juga memberikan semangat baru perjuangan kelas pekerja yang mencapai titik masif di era tersebut.','Hari Buruh ini lahir dari rentetan perjuangan kelas pekerja    ','C','','','','','','','');
