INSERT INTO `soal` VALUES ('137','3','37',' Ketika  Upah  Minimum  Kabupaten  (UMK)  naik,  serta  merta  daya  beli  warga  dan  buruh meningkat.  Pemerintah  bertugas  menjaga  agar permintaan  melonjak  cepat  disikapi dengan persediaan  yang  cukup.  Pemerintah harus bekerja sama dengan pebisnis.  Pebisnis  barang kebutuhan  yang  saat  ini  telah  eksis  didorong  untuk  menambah  stok  barang.  Bila  mereka enggan untuk  menambah  stok barang, pemerintah harus  buka kran agar pemain  baru  masuk. Pemerintah  jangan  sampai  kalah  dengan  mafia,  kartel,  spekulan,  atau  sejenisnya  yang memanfaatkan  situasi  kenaikan  upah  dengan  menaikkan  harga.  Jika demikian adanya, kesejahteraan buruh  tidak  akan  terjadi.  Buruh tidak akan sempat menikmati jerih payahnya mendapatkan penambahan upah. Fakta yang dikemukakan dalam tajuk rencana di atas adalah …','1','Pemerintah  jangan sampai  kalah  dengan  mafia,  kartel,  spekulan,  atau  sejenisnya.','Bila  mereka enggan untuk  menambah  stok barang, pemerintah harus buka kran agar pemain  baru  masuk.','Pebisnis  barang kebutuhan  yang  saat ini  telah  eksis  didorong  untuk  menambah  stok  barang.','Jika demikian adanya, kesejahteraan  buruh  tidak  akan  terjadi.  ','Buruh tidak akan  sempat  menikmati  jerih  payahnya mendapatkan penambahan upah. ','C','','','','','','','');
