INSERT INTO `soal` VALUES ('144','3','44',' ….tapi itu tak dapat dicapai dengan kenduri saja. Masa dan keadaanlah yang menentukan. Ompi yakin, masa itu pasti akan datang. Dan, ia menunggu dengan hati yang disabar-sabarkan. Pada suatu hari yang gilang gemilang, angan-angannya pasti merupa jadi kenyataan. Dia yakin itu bahwa Indra Budiman-nya akan mendapat nama tambahan dokter di muka namanya sekarang. Atau salah satu titel yang mentereng lainnya. Ketika Ompi mulai mengangankan nama dambaannya itu, diambilnya kertas dan potlot ditulisnya nama anak-anak, Dr. Indra Budiman. Dan Ompi merasa bahagia sekali. Ia yakinkan kepada para tetangganya akan cita-citanya yang pasti tercapai itu. Amanat yang terkandung dalam penggalan prosa di atas adalah….','1',' Janganlah terlalu yakin dengan angan-angan sendiri.','Cita-cita orang tua akan tercapai kalau didukung oleh anaknya.','Cita-cita pasti tercapai kalau dilandasi keyakinan akan keberhasilannya.','Asal kita yakin, pengaruh dari orang lain tak ada artinya.','Hendaklah kita yakin dengan apa yang kita cita-citakan.','E','','','','','','','');
INSERT INTO `soal` VALUES ('145','3','45',' “Anak kecil!” Dia tertawa mengejekku. “Mengapa duduk di belakang? Sini! Sini, duduk di muka! Masih ada tempat.” Tangannya melambai, lalu mendekat berjalan ke arah belakang bangku-bangku.\n“Tidak, Pak! Di sini saja, “Jawabku. Dia berdiri di samping bangkuku. Tidak ada yang duduk bersamaku.\n“Mengapa? Supaya paling akhir mendapat giliran?” tanyanya. Seisi kelas tertawa.\n“Tidak, Pak,” kataku lagi. “Supaya dapat melihat orang-orang lain.” Sedangkan mereka, yang duduk di depan, harus berpaling untuk melihatku. Latar tempat dalam kutipan novel tersebut adalah ….','1','warung','kantin','sekolah','ruang tunggu','kelas','E','','','','','','','');
INSERT INTO `soal` VALUES ('146','3','46',' “Walau apa katamu terhadapku, walau kaucaci maki aku, kaukutuki aku, aku terima. Tapi, untuk membiarkan Masri dan Arni hidup sebagai suami istri, padahal Tuhan telah melarangnya, o ... o... o .... itu telah melanggar prinsip hidup setiap orang yang percaya pada-Nya. Kau memang telah berbuat sesuatu yang benar sebagai ibu yang mau memelihara kebahagiaan anaknya. Tapi, ada lagi kebenaran yang lebih mutlak yang tak bisa ditawar-tawar lagi, yakni kebenaran yang dikatakan Tuhan dalam kitab-Nya. Prinsip hidup segala manusialah menjunjung kebenaran Tuhan”Kemarau, A.A. Navis. Nilai agama yang terdapat dalam kutipan novel tersebut ...','1','Melanggar prinsip agarna mendatangkan kesengsaraan.','Kesabaran seorang ayah dalam menghadapi perilaku anakanaknya','Tuhan melarang perkawinan beda agama.','Keikhlasan seorang ibu dalam membahagiakan anaknya.','Segala keputusan hendaknya selalu dikembalikan pada ajaran agama.','E','','','','','','','');
INSERT INTO `soal` VALUES ('147','3','47','(1) Sampai pagi Aku tidak bisa tidur. (2) Benakku penuh diisi keputusan untuk membebastugaskan Juna atau tidak. (3) Aku ragu, apakah Juna akan terlindung dari derita setelah dibebastugaskan itu. (4) tentu Aku tak mau membuat penderitaan baru dalam kehidupan Juna. (5) Tetapi, aku punya hak untuk melepaskan atau tetap mempertahankan. kalimat yang menyatakan bahwa tokoh aku tidak ragu-ragu terdapat pada kalimat nomor ...','1','5','4','3','2','1','E','','','','','','','');
