INSERT INTO `soal` VALUES ('149','3','49',' Empat hari kemudian aku duduk di samping sopir truk yang membawa hasil panen dari desa ke kota. Waktu itu umurku hampir enam belas tahun. Sudah dua tahun aku tidak bersekolah. Keputusan yang diambil ayahku merupakan peraturan yang harus diturut tanpa dirunding pihak yang bersangkutan. Pada waktu itu aku menerimanya dengan kewajaran abadi penuh ketaatan. Ayahku orang yang menentukan dalam kehidupan kami. Dan aku yang dibesarkan dalam lingkungan adat kepala tunduk untuk mengiyakan semua orang tua. Tidak melihat alasan apa pun buat membantahnya. Padahal waktu itu aku khawatir. Tetapi juga gembira. Keduanya disebabkan karena aku akan tinggal di kota. Nilai adat (budaya) yang menonjol dalam penggalan novel tersebut adalah .... ','1','kebiasaan mengangkut hasil panen dari desa ke kota ','orang tua yang memberi doa yang baik kepada anaknya',' orang tua yang menyerahkan anak gadisnya kepada orang lain','ayah menentukan kehidupan anaknya dan harus dituruti oleh anaknya ','anak perempuan yang beranjak remaja ditentukan jodohnya ','E','','','','','','','');
