INSERT INTO `soal` VALUES ('938','18','7','Gubernur DKI Jakarta Anies Baswedan mengatakan, Pemerintah Provinsi DKI telah mencabut izin usaha atau Tanda Daftar Usaha Pariwisata (TDUP) PT Grand Ancol Paragon, perusahaan yang menaungi Alexis. Dengan pencabutan izin itu, maka Alexis dilarang menjalankan usaha apa pun. Anies mengungkapkan alasannya menutup tempat hiburan malam itu.\n\"Bukan narkoba, tapi prostitusi dan perdagangan manusia,\" kata Anies di Balai Kota Jakarta, Selasa, 27 Maret 2018.(liputan6)\nTindakan pak gubernur, termasuk tindakan….\n','1','Menghindarkan dari padatnya transportasi di DKI\n','Menghindarkan dari peredaran narkoba','Menghindarkan dari padatnya pembangunan Hotel','\nMenghindarkan dari padatnya penduduk DKI','Menghindarkan diri dari perbuatan zina','E','','','','','','','');
