INSERT INTO `soal` VALUES ('2077','10','30','CHEF\n\nA chef’s job is much more than a job. Food is much more than a biological necessity. In the right hands, it’s an art form mean to be savored. You can’t taste a photograph or smell a symphony, but good food is meant to be consumed and appreciated with all your senses.\n\nThe culinary artists, or as we call them chefs, have mastered the medium of food, producing dishes that can comfort us and remind us of our dear moms, or energize and inspire us. A good chef can nourish the body and please the palate, leaving us satisfied and wanting more at the same time.\n\nOf course, it is not easy to be a good chef. Specialized training and dedication are key ingredients in the recipe for success. The time you spend in a culinary school will help you develop your natural talents and prepare for successful culinary career.\n\n\n\nThe main idea of the text above is...........\n','1','A good chef','The work of chef','The art of culinary','It is not easy to be a chef','Food is not a part of biological necessity','D','','','','','','','');
INSERT INTO `soal` VALUES ('2078','10','31','CHEF\n\nA chef’s job is much more than a job. Food is much more than a biological necessity. In the right hands, it’s an art form mean to be savored. You can’t taste a photograph or smell a symphony, but good food is meant to be consumed and appreciated with all your senses.\n\nThe culinary artists, or as we call them chefs, have mastered the medium of food, producing dishes that can comfort us and remind us of our dear moms, or energize and inspire us. A good chef can nourish the body and please the palate, leaving us satisfied and wanting more at the same time.\n\nOf course, it is not easy to be a good chef. Specialized training and dedication are key ingredients in the recipe for success. The time you spend in a culinary school will help you develop your natural talents and prepare for successful culinary career.\n\n\n\n\nBased on the text, what is the key to be a successful chef?\n','1','Cleaning the pantry','Preparing food well','Developing natural talents','Spending time in a culinary school','Having specialized training and dedication','B','','','','','','','');
