INSERT INTO `soal` VALUES ('2138','10','4','<table width=\"313\">\r\n<tbody>\r\n<tr>\r\n<td style=\"font-weight: 400;\" width=\"313\">How to Make Flannel Rose Ring<br />Ingridients<br />1.Red Flannel around 10&times;10 cm<br />2.Scissors<br />3.Glue<br />The ways:<br />1.Cut round the flannel about 5&times;3 cm and make spiral in it.<br />2.Glue each side of spiral flannel.<br />3.Twist&nbsp;it from central until the end (look like a rose).<br />4.Cut the flannel in a rectangle (the size depend on your finger).<br />5.Put the rose in a rectangle and glue it.<br />6.Flannel rose ring is ready to wear.<br />Which statement is NOT TRUE about the instruction?</td>\r\n</tr>\r\n</tbody>\r\n</table>','1','<table width=\"129\">\r\n<tbody>\r\n<tr>\r\n<td width=\"129\">We must glue the rose in rectangle to get the ring.</td>\r\n</tr>\r\n</tbody>\r\n</table>','<table width=\"136\">\r\n<tbody>\r\n<tr>\r\n<td width=\"136\">The biggest the finger means the more flannel that needed.</td>\r\n</tr>\r\n</tbody>\r\n</table>','<table width=\"144\">\r\n<tbody>\r\n<tr>\r\n<td width=\"144\">All people have the same size of rectangle to make the ring.</td>\r\n</tr>\r\n</tbody>\r\n</table>','<table width=\"157\">\r\n<tbody>\r\n<tr>\r\n<td width=\"157\">We make a rectangle after we make a rose form.</td>\r\n</tr>\r\n</tbody>\r\n</table>','<table width=\"166\">\r\n<tbody>\r\n<tr>\r\n<td width=\"166\">Flannel rose ring is ready to wear</td>\r\n</tr>\r\n</tbody>\r\n</table>','C','','','','','','','');
